import {Table} from 'reactstrap';
import React, { Component } from "react";
import { Scrollbars } from 'react-custom-scrollbars';


class List extends Component {
    constructor (props) {
        super(props);
        this.state = {
            repList: ["testing1", "testing2", "testing3", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing3", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing3", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4", "testing4",]
        }
    }



    render() {
        return (
            <div style={{height: '90%', paddingLeft: "10px", overflowX: "hidden", overflowY: "auto"}}>
                <Scrollbars style={{height: '100%'}}>
                    <Table borderless id="roomList">
                        <tbody>
                        {
                        this.props.list.map((item, index) =>
                            <tr key={index} >
                                <td style={{height: 50, fontSize: "medium"}}>
                                    <div className="usernames" style={{color: "#424954"}}>{item}</div>
                                </td>
                            </tr>
                        )
                        }
                        </tbody>
                    </Table>
                </Scrollbars>
            </div>
        );
    }
}

export default List;
